contracts/DAY05/p2.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract ArrayOperations {

    int[] public array;

    // Function to insert an element at a particular index
    function insertElement(uint index, int element) public {
        require(index <= array.length, "Index out of bounds");

        // Shift elements to the right to make space for the new element
        array.push(0);  // Increase the array size by 1
        for (uint i = array.length - 1; i > index; i--) {
            array[i] = array[i - 1];  // Shift each element to the right
        }
        array[index] = element;  // Insert the element at the specified index
    }

    // Function to get the current array
    function getArray() public view returns (int[] memory) {
        return array;
    }
}

